const index = () => {
  return (
    <div className="store_advantages">
      <div className="store_advantages__container store__container">
        <div>
          <img src={truck} alt="Frete" />
          <h4>Frete & retorno grátis</h4>
          <p>Frete grátis para todo o país</p>
        </div>
        <div></div>
        <div></div>
      </div>
    </div>
  );
};

export default index;
